import './Formulario.css'

export default class MyForm extends React.Component {
    render() {
      return (
        <form>
          <h1>Hello {this.state.username}</h1>
          <p>Enter your name:</p>
          <input
            type="text"
            onChange= {this.myChangeHandler}
          />
        </form>
      );
    }
  }
